Atmo.Templates["request_imaging_form"] = "\u003Ch1\u003ERequest Imaging\u003C/h1\u003E\u000A\u003Cp\u003EPlease read the \u003Ca href\u003D\u0022https://pods.iplantcollaborative.org/wiki/x/oIZy\u0022 target\u003D\u0022_blank\u0022\u003Ewiki page about requesting an image of your instance\u003C/a\u003E before completing the form below.\u003C/p\u003E\u000A\u003Cform class\u003D\u0022request_imaging_form form\u002Dhorizontal\u0022 method\u003D\u0022post\u0022\u003E\u000A    \u003Cdiv class\u003D\u0022control\u002Dgroup\u0022\u003E\u000A        \u003Clabel for\u003D\u0022name\u0022 class\u003D\u0022control\u002Dlabel\u0022\u003EImage Name\u003C/label\u003E\u000A        \u003Cdiv class\u003D\u0022controls\u0022\u003E\u000A            \u003Cinput type\u003D\u0022text\u0022 name\u003D\u0022name\u0022 class\u003D\u0022span5\u0022 maxlength\u003D\u002230\u0022 size\u003D\u002215\u0022 /\u003E\u000A            \u003Cdiv class\u003D\u0022help\u002Dblock\u0022\u003E\u003Cstrong\u003ESuggested Format:\u003C/strong\u003E [Descriptive Name] [Your Username] [Version]\u000A\u0009\u0009\u0009\u003Cbr /\u003EPlease limit name to 30 characters.\u003C/div\u003E\u000A        \u003C/div\u003E\u000A    \u003C/div\u003E\u000A    \u003Cdiv class\u003D\u0022control\u002Dgroup\u0022\u003E\u000A        \u003Clabel for\u003D\u0022instance\u0022 class\u003D\u0022control\u002Dlabel\u0022\u003EInstance ID\u003C/label\u003E\u000A        \u003Cdiv class\u003D\u0022controls\u0022 style\u003D\u0022position: relative\u003B top: 8px\u0022\u003E\u003C%\u003D id %\u003E\u003C/div\u003E\u000A        \u003Cinput type\u003D\u0022hidden\u0022 name\u003D\u0022instance\u0022 value\u003D\u0022\u003C%\u003D id %\u003E\u0022 /\u003E\u000A    \u003C/div\u003E\u000A    \u003Cdiv class\u003D\u0022control\u002Dgroup\u0022\u003E\u000A        \u003Clabel for\u003D\u0022ip\u0022 class\u003D\u0022control\u002Dlabel\u0022\u003EIP Address\u003C/label\u003E\u000A        \u003Cdiv class\u003D\u0022controls\u0022 style\u003D\u0022position: relative\u003B top: 8px\u0022\u003E\u003C%\u003D public_dns_name %\u003E\u003C/div\u003E\u000A        \u003Cinput type\u003D\u0022hidden\u0022 name\u003D\u0022ip_address\u0022 value\u003D\u0022\u003C%\u003D public_dns_name %\u003E\u0022 /\u003E\u000A    \u003C/div\u003E\u000A    \u003Cdiv class\u003D\u0022control\u002Dgroup\u0022\u003E\u000A        \u003Clabel for\u003D\u0022provider\u0022 class\u003D\u0022control\u002Dlabel\u0022\u003ECloud for Deployment\u003C/label\u003E\u000A        \u003Cdiv class\u003D\u0022controls\u0022\u003E\u000A            \u003Cselect name\u003D\u0022provider\u0022\u003E\u003C/select\u003E\u000A            \u003Cdiv class\u003D\u0022help\u002Dblock\u0022\u003ESelect the cloud provider on which you plan to use this image.\u003C/div\u003E\u000A        \u003C/div\u003E\u000A    \u003C/div\u003E\u000A    \u003Cdiv class\u003D\u0022control\u002Dgroup\u0022\u003E\u000A        \u003Clabel for\u003D\u0022description\u0022 class\u003D\u0022control\u002Dlabel\u0022\u003EDescription of the Image\u003C/label\u003E\u000A        \u003Cdiv class\u003D\u0022controls\u0022\u003E\u000A            \u003Ctextarea name\u003D\u0022description\u0022 style\u003D\u0022width: 80%\u0022 rows\u003D\u00224\u0022\u003E\u003C/textarea\u003E\u000A            \u003Cdiv class\u003D\u0022help\u002Dblock\u0022\u003EConcisely describe the tools installed and their purpose. Please include key words that will help users search for this image and decide whether it will suit their needs.\u003C/div\u003E\u000A        \u003C/div\u003E\u000A    \u003C/div\u003E\u000A    \u003Cdiv class\u003D\u0022control\u002Dgroup\u0022\u003E\u000A        \u003Clabel for\u003D\u0022software\u0022 class\u003D\u0022control\u002Dlabel\u0022\u003EList Installed Software\u003C/label\u003E\u000A        \u003Cdiv class\u003D\u0022controls\u0022\u003E\u000A            \u003Ctextarea name\u003D\u0022software\u0022 style\u003D\u0022width: 80%\u0022 rows\u003D\u00224\u0022\u003E\u003C/textarea\u003E\u000A            \u003Cdiv class\u003D\u0022help\u002Dblock\u0022\u003EList any software that you have installed. If the paths to the executables are different from /usr/bin or /usr/local/bin, list those also.\u003C/div\u003E\u000A        \u003C/div\u003E\u000A    \u003C/div\u003E\u000A    \u003Cdiv class\u003D\u0022control\u002Dgroup\u0022\u003E\u000A        \u003Clabel for\u003D\u0022sys\u0022 class\u003D\u0022control\u002Dlabel\u0022\u003EiPlant\u002Dmanaged System Files\u003C/label\u003E\u000A        \u003Cdiv class\u003D\u0022controls\u0022\u003E\u000A            \u003Ctextarea name\u003D\u0022sys\u0022 style\u003D\u0022width: 80%\u0022 rows\u003D\u00224\u0022\u003E\u003C/textarea\u003E\u000A            \u003Cdiv class\u003D\u0022help\u002Dblock\u0022\u003EIf your VM image requires a change in an iPlant\u002Dmanaged system file (see \u003Ca href\u003D\u0022https://pods.iplantcollaborative.org/wiki/x/oIZy\u0022 target\u003D\u0022_blank\u0022\u003EImportant Notes #4\u003C/a\u003E), let us know the change and why the change is necessary.\u003C/div\u003E\u000A        \u003C/div\u003E\u000A    \u003C/div\u003E\u000A    \u003Cdiv class\u003D\u0022control\u002Dgroup\u0022\u003E\u000A        \u003Clabel for\u003D\u0022sys\u0022 class\u003D\u0022control\u002Dlabel\u0022\u003EFiles to exclude\u003C/label\u003E\u000A        \u003Cdiv class\u003D\u0022controls\u0022\u003E\u000A            \u003Ctextarea name\u003D\u0022exclude\u0022 style\u003D\u0022width: 80%\u0022 rows\u003D\u00224\u0022\u003E\u003C/textarea\u003E\u000A            \u003Cdiv class\u003D\u0022help\u002Dblock\u0022\u003EIf your instance has files you\u0027d like to exclude from the image, list them here.  Write one path per line.\u003C/div\u003E\u000A        \u003C/div\u003E\u000A    \u003C/div\u003E\u000A    \u003Cdiv class\u003D\u0022control\u002Dgroup\u0022\u003E\u000A        \u003Clabel for\u003D\u0022tags\u0022 class\u003D\u0022control\u002Dlabel\u0022\u003EImage Tags\u003C/label\u003E\u000A        \u003Cdiv class\u003D\u0022controls tagger_container\u0022\u003E\u000A            \u003Cinput type\u003D\u0022hidden\u0022 name\u003D\u0022tags\u0022 class\u003D\u0022tag_input\u0022 /\u003E\u000A            \u003Cdiv class\u003D\u0022help\u002Dblock\u0022\u003EPlease include tags that will help users decide whether this image will suit their needs. You can include the operating system, installed software, or configuration information. E.g. Ubuntu, NGS Viewers, MAKER, QIIME, etc.\u003C/div\u003E\u000A        \u003C/div\u003E\u000A    \u003C/div\u003E\u000A    \u003Cdiv class\u003D\u0022control\u002Dgroup\u0022\u003E\u000A        \u003Clabel for\u003D\u0022vis\u0022 class\u003D\u0022control\u002Dlabel\u0022\u003EImage Visibility\u003C/label\u003E\u000A        \u003Cdiv class\u003D\u0022controls\u0022\u003E\u000A            \u003Cselect name\u003D\u0022vis\u0022\u003E\u000A                \u003Coption value\u003D\u0022public\u0022\u003EPublic\u003C/option\u003E\u000A                \u003Coption value\u003D\u0022private\u0022\u003EPrivate\u003C/option\u003E\u000A                \u003Coption value\u003D\u0022select\u0022\u003ESpecific Users\u003C/option\u003E\u000A            \u003C/select\u003E\u000A            \u003Cdiv class\u003D\u0022help\u002Dblock\u0022 id\u003D\u0022vis_help\u0022\u003EA VM image can be made visible to you, a select group of users or to everyone. If you want visibility restricted to a select group of users, provide us a list of iPlant usernames. Public visibility means that any user will be able to launch the instance.\u003C/div\u003E\u000A        \u003C/div\u003E\u000A    \u003C/div\u003E\u000A    \u003Cdiv class\u003D\u0022control\u002Dgroup\u0022\u003E\u000A        \u003Cdiv class\u003D\u0022controls\u0022\u003E\u000A\u0009\u0009\u0009\u003Clabel class\u003D\u0022checkbox\u0022\u003E\u000A\u0009\u0009\u0009\u0009\u003Cinput type\u003D\u0022checkbox\u0022 id\u003D\u0022licensed_software\u0022/\u003E I certify that this image does not contain license\u002Drestricted software that is prohibited from being distributed within a virtual or cloud environment.\u000A\u0009\u0009\u0009\u003C/label\u003E\u000A                        \u003Cbr /\u003E\u000A        \u003C/div\u003E\u000A    \u003C/div\u003E\u000A    \u003Cdiv class\u003D\u0022form\u002Dactions\u0022\u003E\u000A        \u003Cinput type\u003D\u0022submit\u0022 class\u003D\u0022btn btn\u002Dprimary request_image_submit\u0022 value\u003D\u0022Request Imaging\u0022 /\u003E\u000A        \u003Cdiv class\u003D\u0022help\u002Dblock\u0022\u003ENote: All volumes must be detached from an instance before it can be imaged.\u003C/div\u003E\u000A    \u003C/div\u003E\u000A\u003C/form\u003E\u000A";

Atmo.Templates["tagger"] = "\u003Cul class\u003D\u0022tag_list\u0022\u003E\u000A    \u003C% _.each(tags, function(tag) { %\u003E\u000A    \u003Cli data\u002Dtag\u003D\u0022\u003C%\u003D tag %\u003E\u0022\u003E\u003Ca\u003E\u003C%\u003D tag %\u003E\u003C/a\u003E\u003C/li\u003E\u000A    \u003C% })\u003B %\u003E\u000A    \u003Cli class\u003D\u0022edit_tags\u0022\u003E\u003Ca class\u003D\u0022tag_adder\u0022 title\u003D\u0022Add a tag\u0022\u003EEdit Tags\u003C/a\u003E\u003C/li\u003E\u000A    \u003Cli class\u003D\u0022tag_controls\u0022\u003E\u000A        \u003Cform\u003E\u000A            \u003Cinput placeholder\u003D\u0022New Tag\u0022 type\u003D\u0022text\u0022 class\u003D\u0022new_tag\u0022 /\u003E \u000A        \u003C/form\u003E\u000A        \u003Cdiv class\u003D\u0022add_tag_button\u0022\u003EAdd\u003C/div\u003E\u000A        \u003Cdiv class\u003D\u0022done_tagging_button\u0022\u003E\u0026#10004\u003B Done\u003C/div\u003E\u000A        \u003Cul class\u003D\u0022suggested_tags_holder\u0022\u003E\u003C/ul\u003E\u000A    \u003C/li\u003E\u000A\u003C/ul\u003E\u000A";

Atmo.Templates["feedback_form"] = "\u003Cform style\u003D\u0022text\u002Dalign: left\u0022\u003E\u000A    \u003Cspan class\u003D\u0022help\u002Dblock\u0022\u003EPlease share your comments, questions, and concerns.\u003C/span\u003E\u000A    \u003Ctextarea rows\u003D\u00225\u0022 id\u003D\u0022feedback\u0022\u003E\u003C/textarea\u003E\u000A    \u003Cbutton class\u003D\u0022btn btn\u002Dprimary\u0022 id\u003D\u0022submit_feedback\u0022 type\u003D\u0022submit\u0022\u003ESend\u003C/button\u003E\u000A    \u003Ca class\u003D\u0022btn btn\u002Ddefault\u0022 href\u003D\u0022#\u0022 id\u003D\u0022cancel_popover\u0022\u003ECancel\u003C/a\u003E\u000A\u003C/form\u003E\u000A";

