Atmo.Templates["request_resources"] = "\u003Cdiv class\u003D\u0022modal\u002Ddialog\u0022\u003E\u000A   \u003Cdiv class\u003D\u0022modal\u002Dcontent\u0022\u003E\u000A     \u003Cdiv class\u003D\u0022modal\u002Dheader\u0022\u003E\u000A        \u003Cbutton type\u003D\u0022button\u0022 class\u003D\u0022close\u0022 data\u002Ddismiss\u003D\u0022modal\u0022\u003E\u0026times\u003B\u003C/button\u003E\u000A        \u003Ch2\u003ERequest More Resources\u003C/h2\u003E\u000A     \u003C/div\u003E\u000A     \u003Cdiv class\u003D\u0022modal\u002Dbody\u0022\u003E\u000A        \u003Cp\u003E\u000A           \u003Cp class\u003D\u0022alert alert\u002Dinfo\u0022 style\u003D\u0022padding\u002Dleft: 30px\u0022\u003E\u003Ci class\u003D\u0022glyphicon glyphicon\u002Dinfo\u002Dsign\u0022 style\u003D\u0022margin\u002Dleft: \u002D17px\u0022\u003E\u003C/i\u003E \u000A           Depending on the cloud provider, allocations may be expressed as CPUs, RAM, Atmosphere Units (AUs), or a combination of these. One Atmosphere Unit is roughly equivalent to a CPU\u002Dhour, or using one CPU core for one hour. A 16 core instance running for one hour will use 16 AUs. Instances are available on a first\u002Dcome\u002Dfirst\u002Dserved basis. Depending on Atmosphere\u0027s capacity, you may be unable to launch an instance even though you have a sufficient allocation.\u000A           \u003C/p\u003E\u000A           \u000A           \u003Cform name\u003D\u0022request_resources_form\u0022 style\u003D\u0022margin\u002Dbottom: 0\u0022 role\u003D\u0022form\u0022\u003E\u000A              \u003Cinput type\u003D\u0022hidden\u0022 name\u003D\u0022username\u0022 value\u003D\u0022\u003C%\u003D id %\u003E\u0022 /\u003E\u000A\u000A              \u003Cdiv class\u003D\u0022form\u002Dgroup\u0022\u003E\u000A                 \u003Clabel class\u003D\u0022control\u002Dlabel\u0022\u003EWhat resources would you like to request?\u003C/label\u003E\u000A                 \u003Cdiv class\u003D\u0022row\u0022\u003E\u000A                    \u003Cdiv class\u003D\u0022col\u002Dsm\u002D11 col\u002Dsm\u002Doffset\u002D1\u0022\u003E\u000A                       \u003Ctextarea class\u003D\u0022form\u002Dcontrol\u0022 name\u003D\u0022quota\u0022 style\u003D\u0022width: 80%\u0022 rows\u003D\u00223\u0022 placeholder\u003D\u0022E.g 4 CPUs and 8GB memory, running 4 cores for 1 week, an additional 5400 cpu hours, etc.\u0022\u003E\u003C/textarea\u003E\u000A                    \u003C/div\u003E\u000A                 \u003C/div\u003E\u000A              \u003C/div\u003E\u000A              \u003Cdiv class\u003D\u0022form\u002Dgroup\u0022\u003E\u000A                 \u003Clabel class\u003D\u0022control\u002Dlabel\u0022\u003EHow will you use the additional resources?\u003C/label\u003E\u000A                 \u003Cdiv class\u003D\u0022row\u0022\u003E\u000A                    \u003Cdiv class\u003D\u0022col\u002Dsm\u002D11 col\u002Dsm\u002Doffset\u002D1\u0022\u003E\u000A                       \u003Ctextarea class\u003D\u0022form\u002Dcontrol\u0022 name\u003D\u0022reason\u0022 style\u003D\u0022width: 80%\u0022 rows\u003D\u00223\u0022 placeholder\u003D\u0022E.g. To run a program or analysis, store larger output, etc.\u0022\u003E\u003C/textarea\u003E\u000A                    \u003C/div\u003E\u000A                 \u003C/div\u003E\u000A              \u003C/div\u003E\u000A           \u003C/form\u003E\u000A        \u003C/p\u003E\u000A     \u003C/div\u003E\u000A     \u003Cdiv class\u003D\u0022modal\u002Dfooter\u0022\u003E\u000A        \u003Ca href\u003D\u0022#\u0022 class\u003D\u0022btn\u0022 data\u002Ddismiss\u003D\u0022modal\u0022\u003ECancel\u003C/a\u003E\u000A        \u003Ca href\u003D\u0022#\u0022 class\u003D\u0022btn btn\u002Dprimary\u0022 id\u003D\u0022request_resources_btn\u0022\u003ERequest Resources\u003C/a\u003E\u000A     \u003C/div\u003E\u000A   \u003C/div\u003E\u000A\u003C/div\u003E\u000A";

